     &     ((Mf2(4,Gen(1)) + Sub2643(Gen(1),Gen(2),Neu(3),Neu(4)))*
     &       (T - Sub524(Gen(1),Sfe6))) - 
     &    (Sub16(HelAll(Gen(1)),Neu(4),Sfe6)*
     &       Sub2806(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7))/
     &     (T14 - Sub524(Gen(1),Sfe6)) - 
     &    (Sub2816(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)*
     &       Sub8(HelAll(Gen(2)),Neu(4),Sfe6))/
     &     (T24 - Sub2644(Gen(2),Sfe6))

        Sub2845(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7) = 
     &   4*(Sub2808(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)/
     &        ((Mf2(4,Gen(2)) + Sub2643(Gen(1),Gen(2),Neu(3),Neu(4)))*
     &          (T - Sub2644(Gen(2),Sfe6))) + 
     &       Sub2771(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)/
     &        (T24 - Sub524(Gen(1),Sfe6))) - 
     &    4*(Sub2782(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)/
     &        (T14 - Sub2644(Gen(2),Sfe6)) + 
     &       Sub2777(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)/
     &        (U - Sub524(Gen(1),Sfe6))) - 
     &    (Sub2840(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)*
     &       Sub4(HelAll(Gen(1)),Neu(3),Sfe6))/(T - Sub524(Gen(1),Sfe6))+
     &      (Sub16(HelAll(Gen(1)),Neu(4),Sfe6)*
     &       Sub2827(HelAll(Gen(1)),Gen(2),Sfe6,Sfe7)*
     &       Sub79(HelAll(Gen(2)),Neu(3),Sfe7))/
     &     ((U - Sub2685(Gen(2),Sfe7))*(T14 - Sub524(Gen(1),Sfe6))) + 
     &    (8*Abb2*Sub2818(HelAll(Gen(1)),Gen(2),Neu(3),Sfe6,Sfe7)*
     &       Sub8(HelAll(Gen(2)),Neu(4),Sfe6))/
     &     ((T - Sub2644(Gen(2),Sfe6))*(T24 - Sub2644(Gen(2),Sfe6)))

        Sub2846(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7) = 
     &   Sub2844(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7) + 
     &    2*Sub2845(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)

        Sub2847(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7) = 
     &   1/MW2*Sub2846(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,Sfe7)/
     &      CB2 - 12/MW*(Sub2765(HelAll(Gen(1)),Gen(2),Neu(3),Neu(4),Sfe6,
     &         Sfe7)*Sub497(HelAll(Neu(3)),Neu(4)))/(CB*(MHH2 - S34))

        ENDLOOP(Sfe6)
        ENDLOOP(Sfe7)

